import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import './index.css'; // Assuming you have this file for styles
import { GoogleOAuthProvider } from '@react-oauth/google';

// 1. First, create the root element.
const root = ReactDOM.createRoot(document.getElementById('root'));

// 2. Then, use the root to render your application.
root.render(
  <React.StrictMode>
    <GoogleOAuthProvider clientId="1012880997973-b085emkn01huhic0im0g1h4s5t6ebjtf.apps.googleusercontent.com">
      <Router>
        <App />
      </Router>
    </GoogleOAuthProvider>
  </React.StrictMode>
);
